import React from "react";
import { Link } from "react-router-dom";
import './css/Home';

export default function Home(){
    return(
        <div className="home">
            <h1>Home</h1>
            <nav>
                <Link to={'/FindJob'}>Find a Job</Link><br></br>
                <Link to={'/SubmitOffer'}>Submit an Offer</Link>
            </nav>
        </div>
    )
}
